import { useState } from "react";
import axios from "axios";
import { motion } from "framer-motion";
import "./App.css";

function App() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    phone: "",
    gender: "",
    skills: [],
    country: "",
    dob: "",
    message: ""
  });

  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === "checkbox") {
      setFormData((prev) => ({
        ...prev,
        skills: checked
          ? [...prev.skills, value]
          : prev.skills.filter((s) => s !== value)
      }));
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setSuccess(false);

    try {
      await axios.post("http://localhost:5000/submit-form", formData);

      setLoading(false);
      setSuccess(true);

      setTimeout(() => {
        setSuccess(false);
        setFormData({
          name: "",
          email: "",
          password: "",
          phone: "",
          gender: "",
          skills: [],
          country: "",
          dob: "",
          message: ""
        });
      }, 2000);
    } catch (err) {
      setLoading(false);
      alert("Submission failed");
    }
  };

  return (
    <div className="gradient-bg">
      <motion.div
        className="form-container"
        initial={{ opacity: 0, y: 80, scale: 0.9 }}
        animate={{ opacity: 1, y: 0, scale: 1 }}
        transition={{ duration: 0.6, ease: "easeOut" }}
      >
        <h2>Framer Motion Form ðŸš€</h2>

        <form onSubmit={handleSubmit}>
          {[
            { name: "name", placeholder: "Full Name" },
            { name: "email", placeholder: "Email", type: "email" },
            { name: "password", placeholder: "Password", type: "password" },
            { name: "phone", placeholder: "Phone" }
          ].map((field, i) => (
            <motion.input
              key={i}
              type={field.type || "text"}
              name={field.name}
              placeholder={field.placeholder}
              value={formData[field.name]}
              onChange={handleChange}
              whileFocus={{ scale: 1.03 }}
            />
          ))}

          {/* Gender */}
          <motion.div className="radio-group" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
            <label><input type="radio" name="gender" value="Male" onChange={handleChange} /> Male</label>
            <label><input type="radio" name="gender" value="Female" onChange={handleChange} /> Female</label>
          </motion.div>

          {/* Skills */}
          <motion.div className="checkbox-group" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
            <label><input type="checkbox" value="HTML" onChange={handleChange} /> HTML</label>
            <label><input type="checkbox" value="CSS" onChange={handleChange} /> CSS</label>
            <label><input type="checkbox" value="React" onChange={handleChange} /> React</label>
          </motion.div>

          <motion.select
            name="country"
            value={formData.country}
            onChange={handleChange}
            whileFocus={{ scale: 1.03 }}
          >
            <option value="">Select Country</option>
            <option>India</option>
            <option>USA</option>
            <option>UK</option>
          </motion.select>

          <motion.input type="date" name="dob" value={formData.dob} onChange={handleChange} />
          <motion.textarea name="message" placeholder="Message" value={formData.message} onChange={handleChange} />

          {/* BUTTON */}
          <motion.button
            type="submit"
            disabled={loading || success}
            whileHover={{ scale: 1.08 }}
            whileTap={{ scale: 0.95 }}
          >
            {loading && <span className="spinner"></span>}
            {success && (
              <motion.span
                className="checkmark"
                initial={{ scale: 0 }}
                animate={{ scale: 1 }}
                transition={{ type: "spring", stiffness: 300 }}
              ></motion.span>
            )}
            {!loading && !success && "Submit"}
          </motion.button>
        </form>
      </motion.div>
    </div>
  );
}

export default App;
